import React from 'react';
import styled from 'styled-components';
import TodoItem from './todoItem';
import { useTodoState } from '../todoContext';

const TodoListBlock = styled.div`
    flex: 1;
    padding: 20px 32px;
    padding-bottom: 48px;
    overflow-y: auto;
`;

function TodoList(){

    const todos = useTodoState();

    return (
    <TodoListBlock>
        <TodoItem text="프론트앤드 프로젝트 만들기"/>
        <TodoItem text="배고파" done={true}/>
        <TodoItem text="바이크타기" done={true}/>
        <TodoItem text="복습하기" />
    </TodoListBlock>)
}

export default TodoList;
